import React from 'react';
import { Icon, MenuItem, Menu, Input } from 'semantic-ui-react';

const NavBar = () => {
    return (
        <div className="flex flex-col">
            {/* TOPBAR */}
            <div className="flex items-center justify-between p-4 bg-white text-white h-16 fixed w-full z-10">
                <div className="flex items-center justify-start w-1/3">
                    <img src="https://react.semantic-ui.com/logo.png" alt="App Logo" className="h-10 w-10" />
                </div>
                <div className="flex items-center justify-center w-1/3">
                    <Input icon="search" placeholder="Search..." className="mr-4" size='big' />
                </div>
                <div className="flex items-center justify-end w-1/3">
                    <Icon name="sun" size="big" className="mr-4 cursor-pointer" color="black" />
                    <Icon name="settings" size="big" className="mr-4 cursor-pointer" color="black" />
                    <Icon name="user circle" size="big" className="cursor-pointer" color="black" />
                </div>
            </div>
            {/* CONTENT */}
            <div className="flex mt-16">
                {/* SIDEBAR */}
                <Menu vertical fixed="left" className="h-full w-56 bg-white" style={{ marginTop: '4rem' }}>
                    <MenuItem>
                        <Icon name="home" />
                        Home
                    </MenuItem>
                    <MenuItem>
                        <Icon name="chart bar" />
                        Activity
                    </MenuItem>
                    <MenuItem>
                        <Icon name="chat" />
                        Chat
                    </MenuItem>
                    <MenuItem>
                        <Icon name="calendar" />
                        Calendar
                    </MenuItem>
                    <MenuItem>
                        <Icon name="settings" />
                        Settings
                    </MenuItem>
                </Menu>
                {/* MAIN CONTENT */}
               
            </div>
        </div>
    );
};

export default NavBar;
